{
    "question": "Como posso emitir a 2ª via da Nota Fiscal?",
    "answer": "1. A Nota Fiscal eletrônica é enviada via e-mail, portanto o (a) doutor (a) pode imprimir direto do seu correio eletrônico do e-mail cadastrado. A NEODENT não emite uma 2ª via desta Nota Fiscal.

2. A Lei 12.007/2009 (que dispõe sobre a emissão de declaração de quitação anual de débitos pelas pessoas jurídicas prestadoras de serviços públicos ou privados) só se aplica para serviços; e não para compra de mercadorias. Além disso, a relação existente entre Neodent e o dentista não é uma relação de consumo e por isso não se aplicam as regras de Direito do Consumidor.

3. A NEODENT, nas relações mercantis com clientes, não é fonte-pagadora e, portanto, não é responsável tributária, razão pela qual não lhe incumbe tal controle fiscal, ainda que tenhamos sistemicamente como fazê-lo, por causa da rastreabilidade sanitária;

4. Cada cliente é obrigado a manter em boa guarda os documentos fiscais dos produtos que adquire não só para efeitos de garantia, como também para cumprir obrigações fiscais pelo prazo de cinco anos;

5. As opções de pagamento que damos aos clientes, já permitem a partir de extratos bancários ou de cartão de crédito que estes mantenham seu próprio controle;

6. Alguns estados disponibilizam serviços para recuperação e carga (download) dos arquivos através de portais específicos (exemplo Nota Paraná, Nota Fiscal Paulista, Nota Fiscal Gaúcha). Consulte as informações nos sites oficiais do Governo de seu estado.

7. A 2ª via das notas fiscais podem ser retiradas através do Portal Financeiro através do site https://shop.straumann.com/neodent/br/pt_br",
